it("should warn when an expression in the interpolated value is falsy",function(){var e=element(by.id("id3")),t=element(by.id("id8")),i=element(by.id("someOtherId")),o=element(by.id("someOtherId5"));expect(e.getText()).toEqual("View Product 3"),expect(e.getAttribute("href")).toContain("/products/3/view"),expect(t.getText()).toEqual("View Product 8"),expect(t.getAttribute("href")).toContain("/products/8/view"),expect(i.getText()).toEqual("View Product"),expect(i.getAttribute("href")).toContain("/products//view"),expect(o.getText()).toEqual("View Product 5"),expect(o.getAttribute("href")).toContain("/products/5/view"),expect(element(by.binding("warnCount")).getText()).toEqual("Warn Count: 1")});